let state = {
    posts: [
        { id: 1, message: 'Hello, I\'m Natalie', numberOfLikes: '15' },
        { id: 2, message: 'Hi! How are you?', numberOfLikes: '35' },
    ],
    dialogs: [
        { id: 1, name: 'Natalie' },
        { id: 2, name: 'Dora' },
        { id: 3, name: 'Knara' },
        { id: 4, name: 'Nastya' },
        { id: 5, name: 'Tanya' },
        { id: 6, name: 'Ola' }
    ],
    messages: [
        { id: 1, message: 'Hey!' },
        { id: 2, message: 'Hello!' },
        { id: 3, message: 'Hi!' },
        { id: 4, message: 'How do you do?' },
        { id: 5, message: 'What\'s up?' },
    ]
}

export default state;
